"Duck Typing" er en udtryksform indenfor programmering hvor hvilken som helst type, der matcher en givet protokol, accepteres. Dette er en tilbagevendende strategi i JavaScript, hvor det ikke er obligatorisk at skrive funktioner og objekt-metoder for at de skal fungere.

TypeScript har mulighed for at implementere en del af duck typing, men det er ikke det samme som "duck typing". TypeScript er en kompleks og streng syntaks som er baseret på den mere udbredte JavaScript-syntaks. Dette gør det muligt at skrive kod der er mere fleksibel og stabil, og dermed sikre sig at programmet ikke mislyder på grund af enkelte simple fejl.

Med TypeScript kan man udfylde en protokol med den rigtige type for at forbinde objekt og funktioner. Det vil sige at man kan skrive kode der svarer på spørgsmålene om hvilken type objekt-metode eller funktion når man forbinde dem med et givet objekt-type.

For eksempel kan du typisere et værelse i et hotel som følger:

```typescript
class Hotel {
    constructor(name: string, address: string) {
        this.name = name;
        this.address = address;
    }
    getName(): string {
        return this.name;
    }
    getAddress(): string {
        return this.address;
    }
}
```
